import styled from "styled-components";

const CSS = styled.div`
  .main-box{
    background: #3d3d4a;
  color: #898996;
  display:flex;

  padding: 1%;
  margin: 0% 0% 1% 0%;

  .settings{
    font-size: 16px;
    padding: 1%;
    width: 25%;
    box-shadow: rgba(0, 0, 0, 0.25) 0px 0.0625em 0.0625em, rgba(0, 0, 0, 0.25) 0px 0.125em 0.5em, rgba(255, 255, 255, 0.1) 0px 0px 0px 1px inset;
  }
  .results-overview{
    padding: 1%;
    width: 24%;
    font-size: 16px;
    box-shadow: rgba(0, 0, 0, 0.25) 0px 0.0625em 0.0625em, rgba(0, 0, 0, 0.25) 0px 0.125em 0.5em, rgba(255, 255, 255, 0.1) 0px 0px 0px 1px inset;
    margin: 0% 1%;
  }
  .list-of-trades{
    padding:1%;
    width: 50%;
    font-size: 16px;
    box-shadow: rgba(0, 0, 0, 0.25) 0px 0.0625em 0.0625em, rgba(0, 0, 0, 0.25) 0px 0.125em 0.5em, rgba(255, 255, 255, 0.1) 0px 0px 0px 1px inset;

  }
    box-shadow: rgba(0, 0, 0, 0.4) 0px 5px 15px;

  }

`;

export const Homepage = () => {
  return (
    <CSS>
      <h4 className="main-box"> hi test</h4>



